import React from 'react';
import './Tagline.css';

function Tagline() {
  return (
      <div className='tagline-container'>
          <section className='tagline-image-section'>
            <img className='tagline-image' src='/assets/alexander-the-great.png' alt='Alexander The Great'/>
          </section>

          <section className='tagline-content'>
            <h2 className='tagline-header'>
                Ideas made effective
            </h2>
            <p className='tagline-paragraph'>
                When excellence is not an option but an obligation - let's say we make it a habit, that's when we create innovative solutions that drive society and creativity forward.
            </p>
          </section>

          <div style="padding:56.25% 0 0 0;position:relative;">
            /* eslint-disable-next-line */
            <iframe src="https://player.vimeo.com/video/701894737?h=3f997c11b4&badge=0&autopause=0&player_id=0&app_id=58479/embed" allow="autoplay; fullscreen; picture-in-picture" allowfullscreen frameborder="0" style="position:absolute;top:0;left:0;width:100%;height:100%;"></iframe>
          </div>

          <iframe title="QA-chat"src="https://vimeo.com/event/2048912/chat/" width="400" height="600" frameborder="0"></iframe>
      </div>
  );
}

export default Tagline;
